import { NavLink } from 'react-router-dom';

import Header from './Header';
import Footer from './Footer';

function MainNavigation() {
  return (
      <>
        <Header />
        <nav>
          <ul>
            <li>
              <NavLink to="/">Home</NavLink>
            </li>
            <li>
              <NavLink to="/contact">Contact</NavLink>
            </li>
          </ul>
        </nav>
      </>

  );
}

export default MainNavigation;
